import {Button} from "@mui/material";
import { Formik } from "formik";
import React from "react";
import Header from "../../section/header";
import { useStyles } from "./style";
import Input from './../../components/Input'
import { connect, useDispatch } from "react-redux";
import { userSignUp } from "../../store/actions/user";
import { useNavigate } from "react-router";
import { validateEmail } from "../../validate";
import MyForm from "../../section/form";



const SignUp = (props)=>{

  const s = useStyles()
  const navigate = useNavigate()
  const dispatch = useDispatch()




  const onSubmit = (values, { setSubmitting }) => {
    const {firstName,lastName,email,password} = values
    dispatch(userSignUp({firstName,lastName,email,password})) 
    setSubmitting(false)
    navigate('/')
}

const formItem = [
  {
    element:'Input',
    propsItem:{
      type:"firstName",
      name:"firstName",
      placeholder:'First name'
    }

  },
  {
    element:'Input',
    propsItem:{
      type:"lastName",
      name:"lastName",
      placeholder:'Last name',
      sx:{marginTop:'20px'}
    }

  },
  {
    element:'Input',
    propsItem:{
      type:"email",
      name:"email",
      placeholder:'Email',
      sx:{marginTop:'20px'}
    }

  },
  {
    element:'Input',
    propsItem:{
      type:"password",
      name:"password",
      placeholder:'Password',
      sx:{marginTop:'20px'}
    }

  },
  {
    element:'Button',
    propsItem:{
      type:"submit",
      sx:{marginTop:'10px'}
    }

  }
]


  return(
    <div>
      <Header/>
      <div className={s.signUpForm}>
        <MyForm onSubmit={onSubmit} initialValues={{firstName:'',lastName:'',email:'',password:''}} formItem={formItem}/>
      </div>
    </div>
  )
}

export default SignUp
